import React from 'react';

export default () => {
    return (
        <div>
            <div style={{backgroundColor : 'blue', padding : '10px 0', color: '#f7f7f7'}}>
                Chat message
                <ul style={{padding : '0', margin: '0'}}>
                    <li>Hello</li>
                    <li>Nina</li>
                    <li>Cursor</li>
                </ul>
            </div>
        </div>
    )
}
